class Helado {
    constructor(id, imagen, nombre, enStock) {
      this.id = id;
      this.imagen = imagen;
      this.nombre = nombre;
      this.enStock = enStock;
    }

    /* Getters 
    get id() {return this.id};
    get imagen() {return this.imagen};
    get nombre() {return this.nombre};
    get enStock() {return this.ienStockd};*/
}



export default Helado;
